import { Link } from "react-router-dom";

class CourseManager extends React.Component {
    constructor(props) {
        super(props);
    }

    render(){
        return (
            <div className="nav">
                <h3>课程管理</h3>
                <Link >课堂互动</Link>
                <Link >学习讨论</Link>
            </div>
        )
    }
}

export default CourseManager;
